import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Resume extends Component {
  render() {
    return (
      <div>
        <Grid>
          <Cell col={4}>
            <div style={{ textAlign: 'center' }} />
          </Cell>
          <Cell className='resume-body' col={8}>
            Body
          </Cell>
        </Grid>
      </div>
    );
  }
}

export default Resume;
